						width = blockWidth + 'px',
						height = blockHeight + 'px';
					var bgPosition = (iv.scaleBg.shiftx - (columns * blockWidth)) + 'px ' + (iv.scaleBg.shifty - (rows * blockHeight)) + 'px';

